import React from 'react';
import Navbar from './/Navbar';

const App = () => {
  return (
    <div>
      <Navbar />
      <div className="p-4 text-center">
        <h1 className="text-3xl font-bold underline">
          Hello World!
        </h1>
      </div>
    </div>
  );
};

export default App;
